// SPDX-License-Identifier: MIT
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
pragma solidity ^0.8.20;

contract Market{
    IERC20 public erc20;
    IERC721 public erc721;
    bytes4 internal constant  MAGIC_ON_ERC721_RECEIVED = 0x150b7a02;
    struct Order {
        address seller;
        uint256 tokenId;
        uint256 price;
    }
    mapping(uint256 => Order) public orderOfId;
    Order[] public orders ;
    mapping(uint256 => uint256)  idToOrderIndex;  //TokenId To index in orders 

    event Deal(address seller, address buyer, uint256 tokenId, uint256 price);
    event NewOrder(address seller, uint256 tokenId, uint256 price);
    event PriceChange(address seller, uint256 tokenId, uint256 oldPrice, uint256 newPrice);
    event OrderCancel(address seller, uint256 tokenId);

    constructor(address _erc20, address _erc721){
        require(_erc20 != address(0), "error: zero address");
        require(_erc721 != address(0), "error: zero address");
        erc20 = IERC20(_erc20);
        erc721 = IERC721(_erc721);
    }

    // function buy(uint256 _tokenId) external {
    //     address seller = orderOfId[_tokenId].seller;
    //     uint256 price = orderOfId[_tokenId].price;
    //     bool success = erc20.transferFrom(msg.sender,seller,price);
    //     require(success,"transfer not successful");
    //     erc721.safeTransferFrom(address(this),msg.sender,_tokenId);
    //     removeOrder(_tokenId);
    //     emit Deal(seller,msg.sender,_tokenId,price);
    // }

     function buy(uint256 _tokenId, uint256 _price) external {
        require(isListed(_tokenId), "Market: Token ID is not listed");

        address seller = orderOfId[_tokenId].seller;
        address buyer = msg.sender;
        uint256 price = orderOfId[_tokenId].price;

        require(price == _price, "Market: price is not equal");

        require(
            erc20.transferFrom(buyer, seller, price),
            "Market: ERC20 transfer not successfull"
        );
        erc721.safeTransferFrom(address(this), buyer, _tokenId);

        removeOrder(_tokenId);
        emit Deal(buyer, seller, _tokenId, price);
    }


    function cancelOrder(uint256 _tokenId) public {
        address seller = orderOfId[_tokenId].seller;
        require(msg.sender == seller, "not seller");
        erc721.safeTransferFrom(address(this),seller,_tokenId);
        removeOrder(_tokenId);
        emit OrderCancel(seller, _tokenId);
    }

    function chagePrice(uint256 _tokenId,uint256 _newPrice) public {
        address seller = orderOfId[_tokenId].seller;
        require(msg.sender == seller, "not seller");
        uint256 oldPrice = orderOfId[_tokenId].price;
        orderOfId[_tokenId].price = _newPrice;
        Order storage order = orders[idToOrderIndex[_tokenId]];
        order.price = _newPrice;
        emit PriceChange(seller, _tokenId, oldPrice, _newPrice);
    }

    function removeOrder(uint256 _tokenId) internal {
        uint256 index = idToOrderIndex[_tokenId];
        uint256 lastIndex = orders.length-1;

        if (index!= lastIndex) {
            Order storage lastOrder = orders[lastIndex];
            orders[index] = lastOrder;
            idToOrderIndex[_tokenId] = index; 
        }
        orders.pop();
        delete idToOrderIndex[_tokenId];
        delete orderOfId[_tokenId];
    }

    function onERC721Received(address operator, address from, uint256 tokenId, bytes calldata data) external returns(bytes4){
        uint256 price = toUint256(data,0);
        orders.push(Order(from,tokenId,price));
        orderOfId[tokenId] = Order(from,tokenId,price);
        idToOrderIndex[tokenId] = orders.length - 1;
        emit NewOrder(from, tokenId, price);
        require(price >0, "price must be greater than 0");
        return MAGIC_ON_ERC721_RECEIVED;
    }

     function isListed(uint256 _tokenId) public view returns (bool) {
        return orderOfId[_tokenId].seller != address(0);
    }

     // https://stackoverflow.com/questions/63252057/how-to-use-bytestouint-function-in-solidity-the-one-with-assembly
    function toUint256(bytes memory _bytes, uint256 _start)
        internal
        pure
        returns (uint256)
    {
        require(_start + 32 >= _start, "Market: toUint256_overflow");
        require(_bytes.length >= _start + 32, "Market: toUint256_outOfBounds");
        uint256 tempUint;

        assembly {
            tempUint := mload(add(add(_bytes, 0x20), _start))
        }

        return tempUint;
    }

    function getOrdersLength() external view returns(uint256){
        return orders.length;
    }

    function getAllNFTs() external view returns(Order[] memory){
        return orders;
    }

    function getMyNFTS() external view returns(Order[] memory){
        Order[] memory myOrders = new Order[](orders.length);
        uint256 count =0;
        for(uint i =0; i<orders.length;i++){
            if(orders[i].seller == msg.sender){
                myOrders[count] = orders[i];
                count++;
            }
        }
        return myOrders;
    }
}

